import React from 'react';

function Login() {
  const handleLogin = () => {
    window.location.href = 'http://localhost:5000/auth/discord';
  };

  return (
    <div>
      <h2>Login</h2>
      <button onClick={handleLogin}>Login with Discord</button>
    </div>
  );
}

export default Login;
